description:
They are one of the greatest rock and roll bands of all time. For over four decades, they have changed modern music as we know it. But some of their most famous performances have never been released... until now. On December 15, 1977, The Who performed before a select invited audience at the Gaumont State Theatre in Kilburn, North London, to record a concert for Jeff Stein's film, The Kids Are Alright, which turned out to be one of the last live performances by drummer Keith Moon. Shot in 35mm, this holy grail for fans has been digitally restored and remastered in high-definitiion for the ultimate The Who experience. Take an amazing journey with The Who like you've never seen or heard them before, featuring their greatest hits and hours of incredible footage! It's the rock discovery of the year! 

